import React from "react";

const TableRow = (props) => {
  // const {name, phone, } = props
  return (
    <tr>
      <td>{props.name.first}</td>
      <td>{props.name.last}</td>
      <td>{props.email}</td>
      <td>{props.phone}</td>
      <td>
        <img src={props.picture.thumbnail}></img>
      </td>
    </tr>
  );
};

export default TableRow;
